window.bookSummaryJSON = "<p><b>The bestselling author of The Paper Magician Series transports listeners to a darkly whimsical new world where strange magic threatens a quiet village that only a desperate woman can save.</b> </p> <p>Matrona lives in an isolated village, where her life is centered on pleasing her parents. She's diligent in her chores and has agreed to marry a man of their choosing. But a visit to Slava, the local tradesman, threatens to upend her entire life. </p> <p>Entering his empty house, Matrona discovers a strange collection of painted nesting dolls - one for every villager. Fascinated, she can't resist the urge to open the doll with her father's face. But when her father begins acting strangely, she realizes Slava's dolls are much more than they seem. </p> <p>When he learns what she's done, Slava seizes the opportunity to give Matrona stewardship over the dolls - whether she wants it or not. Forced to open one of her own dolls every three days, she falls deeper into the grim power of Slava's creations. But nothing can prepare her for the profound secret hiding inside the fifth doll. </p>"; 
